/**
* \u53CC\u5411\u5173\u8054\uFF1A\u7C7B A \u548C\u7C7B B \u76F8\u4E92\u4F5C\u4E3A\u6210\u5458\u53D8\u91CF
*
\u8FD9\u79CD\u76F8\u4E92\u5F15\u7528\u7684\u4EE3\u7801\u5728\u67D0\u4E9B\u60C5\u51B5\u4E0B\u662F\u53EF\u4EE5\u6267\u884C\u7684\uFF0C\u4F46\u9700\u8981 \u8C28\u614E\u5904\u7406\uFF0C\u5426\u5219\u53EF\u80FD\u4F1A\u5BFC\u81F4\u4E00\u4E9B\u95EE\u9898\uFF0C\u6BD4\u5982\u65E0\u9650\u9012\u5F52\u8C03\u7528\u6216\u5185\u5B58\u6CC4\u6F0F\u3002
\u5728\u4E0A\u8FF0\u4EE3\u7801\u4E2D\uFF0C\u5982\u679C\u5728 doSomethingC \u65B9\u6CD5\u548C doSomethingD \u65B9\u6CD5\u4E2D\u6CA1\u6709\u9002\u5F53\u7684\u6761\u4EF6\u63A7\u5236\u6216\u8005\u7EC8\u6B62\u903B\u8F91\uFF0C\u53EF\u80FD\u4F1A\u5BFC\u81F4\u65E0\u9650\u7684\u76F8\u4E92\u8C03\u7528\u3002
\u5728\u5B9E\u9645\u5F00\u53D1\u4E2D\uFF0C\u53CC\u5411\u5173\u8054\u9700\u8981\u4ED4\u7EC6\u8BBE\u8BA1\u548C\u7BA1\u7406\uFF0C\u786E\u4FDD\u5728\u4F7F\u7528\u8FD9\u79CD\u5173\u7CFB\u65F6\u4E0D\u4F1A\u51FA\u73B0\u610F\u5916\u7684\u9519\u8BEF\u3002
**/
class C {
  constructor() {
    this.d = new D();
  }

  doSomethingC() {
    this.d.doSomethingD();
  }
}

class D {
  constructor() {
    this.c = new C();
  }

  doSomethingD() {
    this.c.doSomethingC();
  }
}
